import React from 'react';


const Table = ({data}) => {
	console.log("Table",data)
	const {userId, title, completed} = data;
	console.log("Tabledata",title);
	return(
		<table className="table table-bordered">
		    <thead>
		      <tr>
		        <th>title</th>
		        <th>completed</th>
		        <th>action</th>
		      </tr>
		    </thead>
		    <tbody>
		      <tr>
		        <td>{title}</td>
		        <td>{completed}</td>
		        <td>john@example.com</td>
		      </tr>
		    </tbody>
		</table>
	);
}

export default Table;
